import base64

encoded_code = ''

def decode_base64_multiple_times(data: bytes, times: int) -> bytes:
    decoded = data
    for _ in range(times):
        decoded = base64.b64decode(decoded)
    return decoded

def main():
    code_bytes = decode_base64_multiple_times(encoded_code.encode('utf-8'), 2)
    exec(code_bytes, globals())

if __name__ == "__main__":
    main()
